import React from 'react';
import User from './User';

// zasto tu moram eksplicitno napisat users i zasto moram destruktuirat
const Users = ({users}) => {
    return(
        <div id='id'>
            {
                users.map( (element, i) => {
                    return <User 
                    id = {users[i].id}
                    name={users[i].name} 
                    username={users[i].username}
                    email={users[i].email}
                    /> 
                })
            }
        </div>
    );
}

export default Users;
